INSERT INTO T_STORE (id, name, webUrl, location, geoPoint, isVerified, isDeleted, popularity, phoneNumber, infoDescription, openingHours, email, cityId, mallId, lastUpdatedTime, numberOfDiscounts) VALUES (7179, 'Reebok', 'https://www.yasmall.ae/en/outlets/reebok/', '', 0x000000000101000000FAEFC16B971E39402E1D739EB1994B40, 1, 0, null, '025650106', 'Reebok is an American-inspired global brand with a deep heritage in fitness. In fact, our mission is to be the best fitness brand in the world. At Reebok, we know that greatness doesn’t come from standing still. We have a long history of pushing boundaries. We’re the brand that helped usher in a fitness movement that forever changed the way we look at spandex and headbands. It’s not the 1980s anymore but today, we continue to be daring in everything we do. We are curious, provocative, witty and unexpected. We are Reebok.', '', '', 279, 7, '2019-10-30 12:48:44', 0);
