INSERT INTO T_STORE (id, name, webUrl, location, geoPoint, isVerified, isDeleted, popularity, phoneNumber, infoDescription, openingHours, email, cityId, mallId, lastUpdatedTime, numberOfDiscounts) VALUES (110145, 'Reebok', 'https://thedubaimall.com/en/shop/reebok', ' First Floor', 0x000000000101000000B421FFCC20323940037976F9D6A34B40, 1, 0, null, '043627500', 'Reebok is an American-inspired global brand with a deep heritage in fitness. In fact, our mission is to be the best fitness brand in the world. At Reebok, we know that greatness doesn’t come from standing still. We have a long history of pushing boundaries. We’re the brand that helped usher in a fitness movement that forever changed the way we look at spandex and headbands. It’s not the 1980s anymore but today, we continue to be daring in everything we do. We are curious, provocative, witty and unexpected. We are Reebok.', '', '', 77, 110, '2019-10-30 12:48:44', 0);
