INSERT INTO T_STORE (id, name, webUrl, location, geoPoint, isVerified, isDeleted, popularity, phoneNumber, infoDescription, openingHours, email, cityId, mallId, lastUpdatedTime, numberOfDiscounts) VALUES (110152, 'H&M', 'https://thedubaimall.com/en/shop/hm', ' Second Floor ', 0x00000000010100000094A5D6FB8D323940D7506A2FA2A34B40, 1, 0, null, '044190346', 'H&M is a fashion brand, offering the latest styles and inspiration for all — always. Customers will find everything from fashion pieces and unique designer collaborations to affordable wardrobe essentials, complete-the-look accessories and motivational workout wear. All seasons, all styles, all welcome! But H&M is more than just fashion. With price, quality and sustainability deeply rooted in its DNA, H&M is not only a possibility for everyone to explore their personal style, but it also offers a chance to create a more sustainable fashion future. Visit hm.com for more information or follow @HM for daily inspiration.', '', '', 77, 110, '2019-10-30 12:48:44', 0);
