INSERT INTO T_STORE (id, name, webUrl, location, geoPoint, isVerified, isDeleted, popularity, phoneNumber, infoDescription, openingHours, email, cityId, mallId, lastUpdatedTime, numberOfDiscounts) VALUES (110846, 'E Max', 'https://thedubaimall.com/en/shop/e-max', ' Second Floor ', 0x0000000001010000003A2009FB7632394001FBE8D495A34B40, 1, 0, null, '043804140', 'Emax is one of the largest electronics retailers in the UAE which functions with the objective of delivering great products and an unparalleled customer experience. Established in the year 2006, as an integral part of the iconic Landmark Group, Emax has grown to be the 2nd largest electronics retail chain in the Middle East with over 30 stores across UAE, Oman and Qatar. It has the widest selection of electronics in the UAE with over 800 brands and 100,000 products all under one roof. The award-winning retailer offers a diverse product range that includes photography, IT, mobiles and telecom, accessories, sound and vision, home appliances, health and fitness, gaming, gifting, personal care, car electronics and navigation, home solutions, MP3 and portable players, toys, music and videos and security solutions.', '', '', 77, 110, '2019-10-30 12:48:44', 0);
