INSERT INTO T_STORE (id, name, webUrl, location, geoPoint, isVerified, isDeleted, popularity, phoneNumber, infoDescription, openingHours, email, cityId, mallId, lastUpdatedTime, numberOfDiscounts) VALUES (120307, 'Emax', 'https://www.malloftheemirates.com/shopping/electronics-home-appliances-computers/emax ', 'Located On Level 1 Nearest Parking Metro Link & C', 0x00000000010100000002840F255A1E3940E1455F419A994B40, 1, 0, null, '043996562', 'Emax is one of the largest electronics retailers in the UAE which functions with the objective of delivering great products and an unparalleled customer experience. Established in the year 2006, as an integral part of the iconic Landmark Group, Emax has grown to be the 2nd largest electronics retail chain in the Middle East with over 30 stores across UAE, Oman and Qatar. It has the widest selection of electronics in the UAE with over 800 brands and 100,000 products all under one roof. The award-winning retailer offers a diverse product range that includes photography, IT, mobiles and telecom, accessories, sound and vision, home appliances, health and fitness, gaming, gifting, personal care, car electronics and navigation, home solutions, MP3 and portable players, toys, music and videos and security solutions.', '', '', 77, 120, '2019-10-30 12:48:44', 0);
