INSERT INTO T_STORE (id, name, webUrl, location, geoPoint, isVerified, isDeleted, popularity, phoneNumber, infoDescription, openingHours, email, cityId, mallId, lastUpdatedTime, numberOfDiscounts) VALUES (120317, 'H&M', 'https://www.malloftheemirates.com/shopping/fashion-unisex/hm ', 'Located On Ground Floor Nearest Parking A & MAIN ENTRANCE', 0x00000000010100000051DA1B7C611E3940486DE2E47E994B40, 1, 0, null, '044190150', 'H&M is a fashion brand, offering the latest styles and inspiration for all — always. Customers will find everything from fashion pieces and unique designer collaborations to affordable wardrobe essentials, complete-the-look accessories and motivational workout wear. All seasons, all styles, all welcome! But H&M is more than just fashion. With price, quality and sustainability deeply rooted in its DNA, H&M is not only a possibility for everyone to explore their personal style, but it also offers a chance to create a more sustainable fashion future. Visit hm.com for more information or follow @HM for daily inspiration.', '', '', 77, 120, '2019-10-30 12:48:44', 0);
